Ext.data.JsonP['Studio_4.3.3_Release_Note']({"guide":"<?xml version=\"1.0\" encoding=\"UTF-8\" ?>\n<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\"\n        \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\n<head>\n    <title>Studio 4.3.3 - 27 October 2015</title>\n\n    <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\n    <meta content=\"Scroll EclipseHelp Exporter\" name=\"generator\">\n\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\" media=\"print\">\n</link></link></link></meta></meta></head>\n<body>\n    <div class=\"container\">\n\t\t<div id=\"banner\" class=\"confbox admonition admonition-note aui-message warning shadowed information-macro\">\n\t\t\t<p>You can now find Appcelerator documentation at <a href=\"https://docs.axway.com/\" target=\"_blank\">https://docs.axway.com/</a>. This site will be taken down in the near future.</p>\n\t\t</div>\n        <div class=\"header\"/>\n\n        <div id=\"src-46244813\" class=\"content\">\n                        <h1>Studio 4.3.3 - 27 October 2015</h1>\n    <p>Studio 4.3.3 is a patch release addressing high-priority issues from previous releases.    </p>\n    <div class=\"section section-2 \" id=\"src-46244813_Studio4.3.3ReleaseNote-FixedIssues\">\n        <h2 class=\"heading \"><span>Fixed Issues</span></h2>\n<ul class=\" \"><li class=\" \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/TISTUD-7747\" target=\"_blank\">TISTUD-7747</a>: LiveView does not work: Script Error Couldn&apos;t find module: localeStrings for architecture: x86_64    </p>\n</li><li class=\" \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/TISTUD-7780\" target=\"_blank\">TISTUD-7780</a>: Launching simulator/emulator creates a new Node.js process without killing the previous one    </p>\n</li><li class=\" \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/TISTUD-7791\" target=\"_blank\">TISTUD-7791</a>: Studio prompts for update to incorrect NPM Appc CLI and SDK    </p>\n</li><li class=\" \">    <p><a class=\"external-link external-link\" href=\"https://jira.appcelerator.org/browse/TISTUD-7796\" target=\"_blank\">TISTUD-7796</a>: If you run &quot;npm ls -g appcelerator&quot; when a pre-release version is installed, &quot;npm ERR! code 1&quot; is returned    </p>\n</li></ul>    </div>\n        </div><a id=\"editButton\" href=\"https://wiki.appcelerator.org/pages/editpage.action?pageId=46244813\"><span>Edit</span></a>\n    \n        \n    </div>\n</body>\n</html>\n","title":"Studio 4.3.3 Release Note"});